INSERT INTO `course` VALUES (13,'Essential Java','Java course for beginners','If you are a computer science graduate or a programmer who wants to learn Java, or someone who wants to start programming with Java, and looking for some awesome resources like books, tutorials, and online courses then you have come to the right place.','Easy','https://www.youtube.com/watch?v=eIrMbAQSU34','https://i.ytimg.com/vi/eIrMbAQSU34/maxresdefault.jpg',1),(14,'Spring Boot Full Course','Full Stack Spring Boot & React (PROFESSIONAL)','Build and Automate Deployment Like Professionals using Spring Boot | React | Maven | Docker | AWS and CICD with Github Actions','Easy','https://www.youtube.com/watch?v=xZq8wETULoM','https://img.youtube.com/vi/xZq8wETULoM/hqdefault.jpg',2),(15,'C# Application From Start to Finish','Tournament Tracker Course C#','Follow along in this free course as I show you how to create an application in C# from idea through the finished product. Everything is shown on screen and in great detail. Learn how to use SQL databases, CSV text files, custom events, Linq, Lambda expressions, emailing, and more. Everything you learn will be in context of a real application.','Advanced','https://www.youtube.com/playlist?list=PLLWMQd6PeGY3t63w-8MMIjIyYS7MsFcCi','https://i.ytimg.com/vi/wfWxdh-_k_4/maxresdefault.jpg',3),(16,'Essential Java 2','Java course for beginners','If you are a computer science graduate or a programmer who wants to learn Java, or someone who wants to start programming with Java, and looking for some awesome resources like books, tutorials, and online courses then you have come to the right place.','Easy','https://www.youtube.com/watch?v=eIrMbAQSU34','https://i.ytimg.com/vi/eIrMbAQSU34/maxresdefault.jpg',1),(17,'Spring Boot Full Course 2','Full Stack Spring Boot & React (PROFESSIONAL)','Build and Automate Deployment Like Professionals using Spring Boot | React | Maven | Docker | AWS and CICD with Github Actions','Easy','https://www.youtube.com/watch?v=xZq8wETUL